select '351823' kf, 491967221 acc, '26305053358520' accnls, 491967321 accproc, '26383053358520' nlsproc from dual union all
select '351823' kf, 491439221 acc, '26303053213720' accnls, 491439321 accproc, '26381053213720' nlsproc from dual union all
select '351823' kf, 492081621 acc, '26307053399220' accnls, 492081721 accproc, '26385053399220' nlsproc from dual union all
select '351823' kf, 491753721 acc, '26304053306120' accnls, 491753821 accproc, '26382053306120' nlsproc from dual union all
select '351823' kf, 491744521 acc, '26302053302320' accnls, 491744621 accproc, '26380053302320' nlsproc from dual union all
select '351823' kf, 491925521 acc, '26303053340820' accnls, 491925621 accproc, '26381053340820' nlsproc from dual union all
select '351823' kf, 491928521 acc, '26302053342120' accnls, 491928621 accproc, '26380053342120' nlsproc from dual union all
select '351823' kf, 491776321 acc, '26308053315720' accnls, 491776421 accproc, '26386053315720' nlsproc from dual union all
select '351823' kf, 491807721 acc, '26301053329520' accnls, 491807821 accproc, '26389053329520' nlsproc from dual union all
select '351823' kf, 491777121 acc, '26305053316120' accnls, 491777221 accproc, '26383053316120' nlsproc from dual ) x
order by x.kf) loop

      if l_kf <> i.kf then
        l_kf := i.kf;
        bc.go(l_kf);
        bars_audit.info(title||' MFO = '||l_kf);
      end if;  
      
     begin 
      select acp.acc, ac.dazs
      into l_accproc, l_accdazs
      from bars.accounts ac,
           bars.accounts acp,
           bars.int_accn ia
      where ac.acc = i.acc
      and ac.nls = i.accnls
      and ia.acc = ac.acc
      and ia.acra = i.accproc
      and acp.acc = i.accproc
      and acp.nls = i.nlsproc
      and ac.dazs is not null
      and acp.dazs is null;
     exception when no_data_found then
      l_accproc := -999;
     end;

    if l_accproc <> -999 then    
       if dpt_web.acc_closing_permitted(l_accproc,0) = 1 then
          update bars.accounts
          set dazs = l_accdazs
          where acc = l_accproc;
          
          bars_audit.info(title||' OK. acc = '||to_char(l_accproc)||' ('||i.nlsproc||') closed');
          commit;   
       else
          bars_audit.info(title||' Error. access denied to close acc = '||to_char(l_accproc)||' ('||i.nlsproc||')');   
       end if;
    end if;   

end loop;
bc.home;
bars_audit.info(title||' finish');

end;
